Score\") +\n","  theme(axis.text.x = element_text(angle = 60, hjust = 1),\n","        axis.title.x = element_text(size = 10))\n","\n","LocationSentiment\n","ggsave(\"LocationSentiment.png\", plot = LocationSentiment)  \n"]},{"cell_type":"markdown","id":"5d16b039","metadata":{"papermill":{"duration":0.026467,"end_time":"2023-12-26T16:24:39.747166","exception":false,"start_time":"2023-12-26T16:24:39.720699","status":"completed"},"tags":[]},"source":["**Conclusion**\n","* The customers are actively speaking on the McDonald's experience as per the word cloud.\n","* The overall sentiment analysis provides a slightly positive sentiment score of 0.058.\n","* Client reviews for store 10 (1415 E State Rd, Fern Park) shows the highest positive sentiment score.\n","* Comparatively, store 14 (1650 Washington Ave, Miami Beach) shows the higest negative sentiment score.\n","* 28/40 stores are showing positive sentiment scores, which indicates good client satisfaction, while indicating room for possible improvements for those with negative scores."]},{"cell_type":"markdown","id":"a6124268","metadata":{"papermill":{"duration":0.025234,"end_time":"2023-12-26T16:24:39.798106","exception":false,"start_time":"2023-12-26T16:24:39.772872","status":"completed"},"tags":[]},"source":["**References**\n","\n","Dataset:\n","Elgiriyewithana, N. (2023) ‘McDonald’s Store Reviews’. "]}],"metadata":{"kaggle":{"accelerator":"none","dataSources":[{"datasetId":3422393,"sourceId":5968827,"sourceType":"datasetVersion"}],"dockerImageVersionId":30618,"isGpuEnabled":false,"isInternetEnabled":false,"language":"r","sourceType":"notebook"},"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":23.27957,"end_time":"2023-12-26T16:24:39.95938","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb",